 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:5.37vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.26vh;font-family:'Oswald';\"><B>Colegio Adventista de Asunci\u00f3n</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:4.7vh;\"><BR STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff0000;font-family:'Oswald Regular';\">Una instituci\u00f3n para el regocijo intelectual, espiritual y personal de nuestros ni\u00f1os en crecimiento.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:4.7vh;\"><BR STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\">La EA considera el proceso educativo de forma integral y promueve la interacci\u00f3n entre la teor\u00eda y la pr\u00e1ctica, el pensar y el hacer, la raz\u00f3n y la emoci\u00f3n, lo individual y lo colectivo, la causa y el efecto; entiende que tanto los educadores como los estudiantes pueden ense\u00f1ar y aprender.</SPAN></DIV><p STYLE=\"margin:0; line-height:4.7vh;\"><BR STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\">La propuesta pedag\u00f3gica de la red EA es respetuosa de las pol\u00edticas y los curr\u00edculos educativos de cada pa\u00eds, con el objetivo fundamental de formar estudiantes reflexivos y creativos. Adem\u00e1s, facilita la transformaci\u00f3n del conocimiento en actitudes, mediante la resoluci\u00f3n de los problemas cotidianos de los estudiantes. Nuestra pedagog\u00eda se basa en las premisas de una educaci\u00f3n cristiana y en el compromiso de guiar todas las actividades did\u00e1cticas hacia la calidad en el proceso de ense\u00f1anza-aprendizaje y la integraci\u00f3n natural de la fe y la ense\u00f1anza.</SPAN></DIV><p STYLE=\"margin:0; line-height:4.7vh;\"><BR STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\">Nuestro curr\u00edculo promueve la excelencia acad\u00e9mica e incluye todos los contenidos esenciales para la pr\u00e1ctica de una ciudadan\u00eda responsable. Su objetivo es desarrollar equilibradamente la vida espiritual, intelectual, f\u00edsica, social, emocional y vocacional de los estudiantes.</SPAN></DIV><p STYLE=\"margin:0; line-height:4.7vh;\"><BR STYLE=\"letter-spacing:0vh; white-space:pre-wrap;color:#000000;font-size:4.7vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
